import React from "react";

const meals = [
  {
    id: "m1",
    name: "Baklava",
    description: "The best of Bosnian sweets",
    price: 2,
  },
  {
    id: "m2",
    name: "Piletina",
    description: "Delicious chicken",
    price: 4,
  },
  {
    id: "m3",
    name: "Riza",
    description: "Delicious rice",
    price: 3.5,
  },
  {
    id: "m4",
    name: "Sarma",
    description: "Traditional Bosnian food",
    price: 4,
  },
];
function AvailableMelas(props) {
  console.log(meals.id);
  return meals.map((meal) => {
    return <li key={meal.id}>{meals.name}</li>;
  });
}

export default AvailableMelas;
